import "./App.css";
import Video from "./components/video";

function App() {

  let arr =[{
    title: 'Through Title and Object',
    views: '11M',
    time: '2 hour ago',
    channel: 'React object',
    verified: true
  },{
    title:"First title",
    views:"100k",
    time:"1 Year ago",
    channel:"Nishant",
    verified : false
  },{
    title: 'Second Title',
    views: '11M',
    time: '2 Month ago',
    channel: 'Bhalothia',
    verified: true
  },{
    title: 'Third title',
    views: '11M',
    time: '1 Month ago',
    channel: 'React object Tutorial',
    verified: false
  }
]
  return (
    <div className="App">
      {
        arr.map(video =><Video
          title={video.title}
          views={video.views}
          time={video.time}
          channel={video.channel}
          verified = {video.verified}
        ></Video>)
      }

    </div>
  );
}

export default App;

